import {StyleSheet} from "react-native"

export default StyleSheet.create({
      card: {
        width: "70%",
        height: 100,
        borderBottomColor: 'black',
        borderBottomWidth: 2,
        alignItems: 'center',
        justifyContent: "space-evenly",
        flexDirection: "row",
        alignSelf: "center"
      },
      title:{
        fontSize: 18
      },
      image:{
        width: 190,
        height: 150,
        marginTop: "10%"
      },
      fotoText:{
        backgroundColor: "#C4C4C4",
        borderRadius: 60,
        width: "30%",
        height: "80%",
        alignItems: "center",
        justifyContent: "center"
      },
      scrollView: {
        width: "100%",
        height: "65%",
        marginHorizontal: 20,
      },
      textInfo:{
        fontSize: 18
      }
})
